template<PieceType Pt>
constexpr uint64_t attacks_bb(Square s, uint64_t occupied = 0ull)
{
	#if (DEBUG)
		assert(Pt != PAWN);
		assert(::is_ok(s));
	#endif
	if constexpr (Pt == ROOK)
		return ROOK_MAGICS[s].attacks[ROOK_MAGICS[s].index(occupied)];
	if constexpr (Pt == BISHOP)
		return BISHOP_MAGICS[s].attacks[BISHOP_MAGICS[s].index(occupied)];
	if constexpr (Pt == QUEEN)
		return ROOK_MAGICS[s].attacks[ROOK_MAGICS[s].index(occupied)] | BISHOP_MAGICS[s].attacks[BISHOP_MAGICS[s].index(occupied)];
	if constexpr (Pt == KNIGHT || Pt == KING)
		return PIECE_ATTACKS[Pt][s];
}

constexpr uint64_t attacks_bb(PieceType pt, Square s, uint64_t occupied = 0ull)
{
	#if (DEBUG)
		assert(pt != PAWN);
		assert(::is_ok(s));
	#endif
	switch (pt)
	{
		case ROOK:   return attacks_bb<ROOK>(s, occupied);
		case BISHOP: return attacks_bb<BISHOP>(s, occupied);
		case QUEEN:  return attacks_bb<QUEEN>(s, occupied);
		default: return PIECE_ATTACKS[pt][s];
	}
}

template<Direction D>
constexpr uint64_t shift(uint64_t bb)
{
	if constexpr (D == Direction::N)
		return bb << 8;
	if constexpr (D == Direction::S)
		return bb >> 8;
	if constexpr (D == Direction::NN)
		return bb << 16;
	if constexpr (D == Direction::SS)
		return bb >> 16;
	if constexpr (D == Direction::E)
		return (bb & ~FILEH_BB) << 1;
	if constexpr (D == Direction::W)
		return (bb & ~FILEA_BB) >> 1;
	if constexpr (D == Direction::NE)
		return (bb & ~FILEH_BB) << 9;
	if constexpr (D == Direction::NW)
		return (bb & ~FILEA_BB) << 7;
	if constexpr (D == Direction::SE)
		return (bb & ~FILEH_BB) >> 7;
	if constexpr (D == Direction::SW)
		return (bb & ~FILEA_BB) >> 9;
}

template<Color C>
constexpr uint64_t pawn_attacks_bb(uint64_t bb)
{
	if constexpr (C == WHITE) 
		return shift<NW>(bb) | shift<NE>(bb);
	else 
		return shift<SW>(bb) | shift<SE>(bb);
}

constexpr uint64_t pawn_attacks_bb(Color c, Square s) 
{ 
	#if (DEBUG)
		assert(::is_ok(s));
	#endif
	return PAWN_ATTACKS[c][s]; 
}

constexpr Direction pawn_push(Color c) { return c == WHITE ? Direction::N : Direction::S; }


